import React, {useState, useEffect} from "react";
import PlayerDataService from "../services/playersService";
const CourseScorecard = props => {
    const saveArray = (event) => {
        event.preventDefault();
        var data = {
            par_holes: event.getElementsByName('scores[]')
        }

        PlayerDataService.createPlayer(data)
            .then(response => {
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });

    }
    return(
        <>
           <form onSubmit={saveArray}>
            <table>
                <tr>
                    <th>1</th>
                    <th>2</th>
                    <th>3</th>
                </tr>
                <tr>
                    <td><input type="number" name="scores[]" /></td>
                    <td><input type="number" name="scores[]" /></td>
                    <td><input type="number" name="scores[]" /></td>
                </tr>
            </table>
            <button type="submit" className="btn btn-success">
                Submit Scores
            </button>
           </form>
        </>
        
    )
}
export default CourseScorecard;
